## II. BACKGROUND
## A. Post-HLS Intermediate Representation

The initial HLS phase parses algorithms in HLL into virtual instruction sets called intermediate representations. Subsequent phases entail specifying the order and timing of these instructions under predefined constraints to generate PIRs [20]. PIR is a comprehensive representation of the synthesized design in the CDFG format and accurately describes the hardware designs. Consequently, we use PIR to capture hardware design variations induced by pragmas. PIR CDFG is composed of nodes and edges, each labeled with specific types and attributes. A toylike code is illustrated in Fig. 1 (a) with no pragma applied, and its corresponding PIR generated through Vitis HLS [24] is illustrated in Fig. 1 (b). Node attributes include node types, bitwidths, and consts, while edge attributes include edge types and data flow directions. For example, the node add_ln7 of type 0 , indexed at 18 , denotes an add operation with a bitwidth of 3 . The edge indexed at 40 is of type 2 .

```
void foo(int in_1[4], int in_2[4], int out[4]){
    for(int i=0; i<4; i++)
        out[i]=in_1[i]+in_2[i];
}
```

