## C. Variational Autoencoder

Variational Autoencoder (VAE) is an encoder-decoder methodology [28] for variational inference [29], aimed at generating data within the distribution of input data $\mathbf{x}$. The encoder models the posterior $q(\mathbf{z} \mid \mathbf{x})$. The decoder models the likelihood $p(\mathbf{x} \mid \mathbf{z})$ and maps prior samples into the data within the targeting distribution. Its training objective is expressed below:

$$
\begin{aligned}
& \underset{\mu, m, v}{\operatorname{argmin}}\left\{E_{q(\mathbf{z} \mid \mathbf{x})}[\frac{\|\mathbf{x}-\mu(\mathbf{z})\|_{2}^{2}}{2 c}]\right. \\
& \left.-\sum_{i} \frac{1}{2}\left[1+\log v_{i}(\mathbf{x})-v_{i}(\mathbf{x})-m_{i}^{2}(\mathbf{x})\right]\right\}
\end{aligned}
$$

where the function $\mu$ maps prior sample into the mean of $p(\mathbf{x} \mid \mathbf{z})$ at the bottleneck. Hyperparameter $c$ governs the variance of $p(\mathbf{x} \mid \mathbf{z})$, while the functions $m_{i}$ and $v_{i}$ calculate the mean and variance, respectively, of the $i$-th dimension of $\mathbf{z} \sim q(\mathbf{z} \mid \mathbf{x})$. By combining conditioning variables into latent samples, VAE learns conditional distributions.
